import React from "react";
import "./../index.css";
import HTML from "../images/html.png";
import CSS from "../images/css.png";
import Javascript from "../images/javascript.png";
import Reactlogo from "../images/React.png";
import Node from "../images/node-js.png";
import Bootstrap from "../images/Bootstrap.svg";
import Heroku from "../images/Heroku";
import Git from "../images/Git";
import MySql from "../images/MySql";

const About = () => {
  return (
    <section
      data-aos="fade-right"
      className="about-container"
      name="about"
      id="about"
    >
      <h1 className="heading">About Me</h1>
          <h3>
            <i>Hi, I'm David</i>
          </h3>
          <p>
            
            
          </p>
          <h3>
            <i>Where I'm From</i>
          </h3>
          <p>
            
            
          </p>
          <h3>
            <i>Where I'm Headed</i>
          </h3>
          <p>
            
         
          </p>
  
          <div className="skills-lang">
                            <img src={HTML} alt="Bootstrap" /> &nbsp; 
                            <img src={CSS} alt="Django" /> &nbsp; 
                            <img src={Javascript} alt="JavaScript" /> &nbsp; 
                            <img src={Reactlogo} alt="React" /> &nbsp; 
                            <img src={Node} alt="Go" /> &nbsp; 
                            <img src={Bootstrap} alt="C++" /> &nbsp; 
                            <img src={Heroku} alt="C" /> &nbsp; 
                            <img src={Git} alt="HTM5" /> &nbsp; 
                            <img src={MySql} alt="CSS3" />
          </div><br />
    </section>
  );
};

export default About;
